import "./MainView.css";
import CityCard from  "../components/CityCard.js";
import { BsCloudSun } from 'react-icons/fa';

function MainView() {
  return (
    <div class="singleview">
        <div class="header">Nagłówek
        <BsCloudSun/></div>
        <div class="searching">Wyszukiwanie</div>
        <div class="space">Treść
        <CityCard/>
        </div>
    </div>
  )
}

export default MainView
